import React from 'react';

import styles from './FinishLine.module.scss';

function FinishLine() {

   return (
      <div className = { styles.trackLine } >
         <div className = { styles.background }></div>
         <div className = { styles.background }></div>
         <div className = { styles.background }></div>
         <div className = { styles.background }></div>
      </div>
   )
}

export default FinishLine;
